},
{
    disease: 'cancer'
},
{
    disease: 'typhoid'
},
{
    disease: 'paralisis'
},
{
    disease: 'eezema'
},
{
    disease: 'dengue'
},
{
    disease: 'allergy'
},
{
    disease: 'epilepsy'
}]
export default function PatientList (){
    const {styles} = useStyle();
  return (
    <View style={styles.container}>
       <Text style={styles.text}>Patient List</Text>
       <FlatList
       data={patientData}
       nestedScrollEnabled={true}
       renderItem={({ item }) => <Items itemData={item}/> }
       />
    </View>
  )
}

const useStyle = () => {
    const { width, height} = useWindowDimensions();
    const styles = StyleSheet.create({
    container: {
    width: width,
    marginTop: 20
  },
  text: {
    alignItems: 'center',
    justifyContent: 'center',
    fontWeight: 'bold',
    fontSize: 20,
    marginLeft: 140,
    marginBottom:10
  }
    })
    return {styles}
}
